import React, { useEffect } from "react";
import Cookies from "js-cookie";

function Profile() {
  const user_id = Cookies.get("user-id");
  useEffect(() => {}, []);
  const date = Date.now();
  const result = date.toTimeString();
  return (
    <div>
      <div>사용자 id : {user_id}</div>
      <div>{result}</div>
    </div>
  );
}

export default Profile;
